import React from 'react';
import './Header.css';

interface HeaderProps {
  activeTab: string;
  onTabChange: (tab: string) => void;
  onLogout?: () => void;
}

const Header: React.FC<HeaderProps> = ({ activeTab, onTabChange, onLogout }) => {
  return (
    <header className="header">
      <div className="header-container">
        <div className="logo-section">
          <h1 className="company-name">Moder Car Sale</h1>
          <p className="company-subtitle">Advanced Accounting System</p>
          <p className="powered-by">Powered by NextWave Tech Labs</p>
        </div>

        <nav className="nav-menu">
          <button 
            className={`nav-btn ${activeTab === 'overview' ? 'active' : ''}`}
            onClick={() => onTabChange('overview')}
          >
            Dashboard
          </button>
          <button 
            className={`nav-btn ${activeTab === 'orders' ? 'active' : ''}`}
            onClick={() => onTabChange('orders')}
          >
            Vehicle Orders
          </button>
          <button 
            className={`nav-btn ${activeTab === 'customer_bookings' ? 'active' : ''}`}
            onClick={() => onTabChange('customer_bookings')}
          >
            Customer Bookings
          </button>
          <button 
            className={`nav-btn ${activeTab === 'inventory' ? 'active' : ''}`}
            onClick={() => onTabChange('inventory')}
          >
            Inventory
          </button>
          <button 
            className={`nav-btn ${activeTab === 'billing' ? 'active' : ''}`}
            onClick={() => onTabChange('billing')}
          >
            Billing & POS
          </button>
          <button 
            className={`nav-btn ${activeTab === 'expenses' ? 'active' : ''}`}
            onClick={() => onTabChange('expenses')}
          >
            Expenses
          </button>
      <button 
        className={`nav-btn ${activeTab === 'reports' ? 'active' : ''}`}
        onClick={() => onTabChange('reports')}
      >
        Reports
      </button>
        </nav>

        <div className="header-actions">
          <div className="user-info">
            <span className="user-name">{localStorage.getItem('username') || 'Admin User'}</span>
            <div className="user-avatar">{(localStorage.getItem('username') || 'A').charAt(0).toUpperCase()}</div>
          </div>
          {onLogout && (
            <button className="logout-btn" onClick={onLogout} title="Logout">
              ðŸšª Logout
            </button>
          )}
        </div>
      </div>
    </header>
  );
};

export default Header;
